import React, { useState } from 'react';
import axios from 'axios';
import Select from 'react-select';

const BondForm = () => {
    // Initial state setup for the form
    const [formData, setFormData] = useState({
        k: '',
        maturity_date: '',
        delta: '',
        pi: '',
        coupon_rate: '',
        face_value: '',
        day_count_convention: { value: '0', label: 'Thirty/360' }, // Using an object for the select component
        upload_file: null
    });

    // Options for the day count convention dropdown
    const dayCountOptions = [
        { value: '0', label: 'Thirty/360' },
        { value: '1', label: 'Thirty/365' },
        { value: '2', label: 'Actual/360' },
        { value: '3', label: 'Actual/365' },
        { value: '4', label: 'Actual/Actual' }
    ];

    // Handle changes for inputs and select
    const handleChange = (event) => {
        const { name, value, type, files } = event.target;
        if (type === 'file') {
            setFormData(prev => ({ ...prev, upload_file: files[0] }));
        } else {
            setFormData(prev => ({ ...prev, [name]: value }));
        }
    };

    // Handle changes for the React-Select component
    const handleSelectChange = (selectedOption) => {
        setFormData(prev => ({ ...prev, day_count_convention: selectedOption }));
    };

    // Handle form submission
    const handleSubmit = async (event) => {
        event.preventDefault();
        const formDataToSend = new FormData();
        formDataToSend.append('upload_file', formData.upload_file);

        const json = JSON.stringify({
            k: formData.k,
            maturity_date: formData.maturity_date,
            delta: formData.delta,
            pi: formData.pi,
            coupon_rate: formData.coupon_rate,
            face_value: formData.face_value,
            day_count_convention: formData.day_count_convention.value
        });
        formDataToSend.append('json', new Blob([json], { type: 'application/json' }));

        try {
            const response = await axios.post('http://localhost:3001/submit', formDataToSend, {
                headers: {
                    'Content-Type': 'multipart/form-data'
                }
            });
            console.log('Submission successful', response.data);
        } catch (error) {
            console.error('Error submitting form:', error);
        }
    };

    return (
        <form onSubmit={handleSubmit} className="container">
            <div className="input-field">
                <label htmlFor="k">Strike Price</label>
                <input id="k" name="k" type="number" value={formData.k} onChange={handleChange} />
            </div>
            <div className="input-field">
                <label htmlFor="maturity_date">Maturity Date</label>
                <input id="maturity_date" name="maturity_date" type="date" value={formData.maturity_date} onChange={handleChange} />
            </div>
            <div className="input-field">
                <label htmlFor="delta">Delta</label>
                <input id="delta" name="delta" type="number" value={formData.delta} onChange={handleChange} />
            </div>
            <div className="input-field">
                <label htmlFor="pi">Pi</label>
                <input id="pi" name="pi" type="number" value={formData.pi} onChange={handleChange} />
            </div>
            <div className="input-field">
                <label htmlFor="coupon_rate">Coupon Rate</label>
                <input id="coupon_rate" name="coupon_rate" type="number" value={formData.coupon_rate} onChange={handleChange} />
            </div>
            <div className="input-field">
                <label htmlFor="face_value">Face Value</label>
                <input id="face_value" name="face_value" type="number" value={formData.face_value} onChange={handleChange} />
            </div>
            <div className="input-field">
                <label htmlFor="day_count_convention">Day Count Convention</label>
                <Select
                    id="day_count_convention"
                    name="day_count_convention"
                    value={formData.day_count_convention}
                    onChange={handleSelectChange}
                    options={dayCountOptions}
                />
            </div>
            <div className="file-field input-field">
                <div className="btn">
                    <span>File</span>
                    <input type="file" name="upload_file" onChange={handleChange} />
                </div>
            </div>
            <button type="submit" className="btn">Submit</button>
        </form>
    );
};

export default BondForm;
